import React from "react";

export default function Transfer() {
  return (
    <main className="section-container">
      <h1 className="section-title">How to Transfer Your License</h1>
      <p className="lead">
        Moving from another brokerage? We make transfers fast and simple. Sign transfer forms via
        DocuSign and we’ll coordinate activation—typically within 24–48 hours once approved.
      </p>
      <ol>
        <li>Tell us your current broker + license #.</li>
        <li>Sign transfer + ARAD agreements digitally.</li>
        <li>We confirm activation with the state.</li>
      </ol>
    </main>
  );
}
